DROP TABLE IF EXISTS `payroll_record`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `payroll_record` (
  `payroll_id` int NOT NULL AUTO_INCREMENT,
  `pay_period_id` int NOT NULL,
  `employee_id` int NOT NULL,
  `attendance_processing_id` int NOT NULL,
  `basic_salary` decimal(10,2) NOT NULL,
  `overtime_pay` decimal(10,2) NOT NULL,
  `total_allowance` decimal(10,2) DEFAULT NULL,
  `gross_salary` decimal(10,2) DEFAULT NULL,
  `total_deduction` decimal(10,2) DEFAULT NULL,
  `net_salary` decimal(10,2) DEFAULT NULL,
  `created_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `submitted_date` date DEFAULT NULL,
  PRIMARY KEY (`payroll_id`),
  KEY `fk_payroll_period` (`pay_period_id`),
  KEY `fk_payroll_employee` (`employee_id`),
  KEY `fk_payroll_attendance` (`attendance_processing_id`),
  CONSTRAINT `fk_payroll_attendance` FOREIGN KEY (`attendance_processing_id`) REFERENCES `attendance_processing` (`attendance_processing_id`),
  CONSTRAINT `fk_payroll_employee` FOREIGN KEY (`employee_id`) REFERENCES `employee_personal_information` (`employee_id`),
  CONSTRAINT `fk_payroll_period` FOREIGN KEY (`pay_period_id`) REFERENCES `pay_period` (`pay_period_id`),
  CONSTRAINT `chk_payroll_basic_salary_non_negative` CHECK ((`basic_salary` >= 0)),
  CONSTRAINT `chk_payroll_gross_salary_non_negative` CHECK ((`gross_salary` >= 0)),
  CONSTRAINT `chk_payroll_net_salary_non_negative` CHECK ((`net_salary` >= 0)),
  CONSTRAINT `chk_payroll_overtime_pay_non_negative` CHECK ((`overtime_pay` >= 0)),
  CONSTRAINT `chk_payroll_total_allowance_non_negative` CHECK ((`total_allowance` >= 0)),
  CONSTRAINT `chk_payroll_total_deductions_non_negative` CHECK ((`total_deduction` >= 0))
) ENGINE=InnoDB AUTO_INCREMENT=10884 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

