CREATE DEFINER=`root`@`localhost` PROCEDURE `generate_monthly_payroll_summary`(IN input_month VARCHAR(7))
BEGIN	
	SELECT
		GROUP_CONCAT(
		CONCAT(
			DATE_FORMAT(start_date, '%m-%d-%Y'),
			' to ',
			DATE_FORMAT(end_date, '%m-%d-%Y')
		)
        ORDER BY start_date
        SEPARATOR '\n') AS `Pay Period`,
		pr.employee_id AS 'Employee No',
        CONCAT(e.last_name, ', ', e.first_name) AS 'Employee Full Name',
        j.job_title AS 'Position',
        d.department_name AS 'Department',
        ROUND(SUM(pr.gross_salary),2) AS 'Gross Income',
        
        egi.sss_number AS 'Social Security No.',
        ROUND(SUM(IFNULL(sss.amount, 0)),2) AS 'Social Security Contribution',
        
        egi.philhealth_number AS 'Philhealth No.',
        ROUND(SUM(IFNULL(phi.amount, 0)),2) AS 'Philhealth Contribution',
        
        egi.pagibig_number AS 'Pag-ibig No.',
        ROUND(SUM(IFNULL(pg.amount, 0)),2) AS 'Pag-Ibig Contribution',
        
        egi.tax_identification_number AS 'TIN',
        ROUND(SUM(IFNULL(wt.amount, 0)),2) AS 'Withholding Tax',
		
        ROUND(SUM(pr.net_salary),2) AS 'Net Pay'
    
    FROM payroll_record pr
    JOIN pay_period pp
		ON pr.pay_period_id = pp.pay_period_id
    JOIN employee_personal_information e
		ON pr.employee_id = e.employee_id
	JOIN employee_employment_information ee
		ON pr.employee_id = ee.employee_id
	JOIN job j
		ON ee.job_id = j.job_id
	JOIN department d
		ON j.department_id = d.department_id
	JOIN employee_government_information egi
		ON pr.employee_id = egi.employee_id
	
    JOIN (
		SELECT
			egd.payroll_id,
            SUM(egd.amount) AS amount
        FROM employee_government_deduction egd
        JOIN government_deduction_chart gdc
			ON egd.chart_id = gdc.gov_deduction_chart_id		
        WHERE gdc.gov_deduction_type_id IN (1)
        GROUP BY egd.payroll_id
    ) sss
		ON pr.payroll_id = sss.payroll_id
	
    LEFT JOIN (
		SELECT
			egd.payroll_id,
            SUM(egd.amount) AS amount
        FROM employee_government_deduction egd
        JOIN government_deduction_chart gdc
			ON egd.chart_id = gdc.gov_deduction_chart_id		
        WHERE gdc.gov_deduction_type_id IN (3)
        GROUP BY egd.payroll_id
    ) phi
		ON pr.payroll_id = phi.payroll_id
	
    LEFT JOIN (
		SELECT
			egd.payroll_id,
            SUM(egd.amount) AS amount
        FROM employee_government_deduction egd
        JOIN government_deduction_chart gdc
			ON egd.chart_id = gdc.gov_deduction_chart_id		
        WHERE gdc.gov_deduction_type_id IN (2)
        GROUP BY egd.payroll_id
    ) pg
		ON pr.payroll_id = pg.payroll_id
	
    JOIN (
		SELECT
			egd.payroll_id,
            SUM(egd.amount) AS amount
        FROM employee_government_deduction egd
        JOIN government_deduction_chart gdc
			ON egd.chart_id = gdc.gov_deduction_chart_id		
        WHERE gdc.gov_deduction_type_id IN (4)
        GROUP BY egd.payroll_id
    ) wt
		ON pr.payroll_id = wt.payroll_id
        
	WHERE DATE_FORMAT(pp.end_date, '%Y-%m') = input_month
	GROUP BY e.employee_id, e.first_name, e.last_name, j.job_title, d.department_name,
             egi.sss_number, egi.philhealth_number, egi.pagibig_number, egi.tax_identification_number

    ORDER BY e.last_name, e.first_name;
END ;;
DELIMITER ;
