CREATE DEFINER=`root`@`localhost` PROCEDURE `generate_monthly_pay_periods`(IN input_month VARCHAR(7))
BEGIN
	SELECT
		GROUP_CONCAT(
		CONCAT(
			DATE_FORMAT(start_date, '%m-%d-%Y'),
			' to ',
			DATE_FORMAT(end_date, '%m-%d-%Y')
		)
        ORDER BY start_date
        SEPARATOR '\n') AS `Pay Period`
	FROM pay_period
	WHERE DATE_FORMAT(end_date, '%Y-%m') = input_month;
END ;;
DELIMITER ;
