DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `generate_payslips_for_period`(IN input_payperiod_id  INT)
BEGIN
	-- Step 1: Loop through all payroll records for the given pay period
	DECLARE done INT DEFAULT 0;
	DECLARE var_payroll_id INT;
	DECLARE var_employee_id INT;
    
	-- Cursor to get each payroll record ID and employee ID for the pay period
    DECLARE cur CURSOR FOR
        SELECT payroll_id, employee_id
        FROM payroll_record
        WHERE pay_period_id = input_payperiod_id;
        
    -- Handler for end of data
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

    OPEN cur;    
    
    read_loop: LOOP
        FETCH cur INTO var_payroll_id, var_employee_id;
        IF done THEN
            LEAVE read_loop;
        END IF;        

        -- Avoid inserting duplicate payslip
        IF NOT EXISTS (
            SELECT 1 FROM payslip
            WHERE payroll_id = var_payroll_id AND employee_id = var_employee_id
        ) THEN
			INSERT INTO payslip (
				payroll_id,
				employee_id, 
				position,
				department,
				monthly_rate,
				daily_rate,
				days_worked,
				overtime,
				total_allowance,
				gross_salary,
				total_deductions,
				net_salary,
				generated_date 
			)
			SELECT
				pr.payroll_id,
				pr.employee_id,
				j.job_title,
				d.department_name,
				s.basic_salary,
				s.hourly_rate AS hourly_rate,
				ap.payable_hours AS payable_hours,
				pr.overtime_pay,
				pr.total_allowance,
				pr.gross_salary,
				pr.total_deduction,
				pr.net_salary,
				CURDATE()
			FROM payroll_record pr
			JOIN employee_employment_information ee
				ON pr.employee_id = ee.employee_id
			JOIN job j
				ON ee.job_id = j.job_id
			JOIN department d
				ON j.department_id = d.department_id
			JOIN salary s
				ON ee.salary_id = s.salary_id
			JOIN attendance_processing ap
				ON pr.employee_id = ap.employee_id
				AND pr.pay_period_id = ap.pay_period_id
            WHERE pr.payroll_id = var_payroll_id AND pr.employee_id = var_employee_id;
        END IF;

    END LOOP;

    CLOSE cur;
END ;;
DELIMITER ;
