CREATE DEFINER=`root`@`localhost` PROCEDURE `generate_payslip_preview_by_employee_id`(
    IN input_employee_id INT,
    IN input_pay_period_id INT
)
BEGIN
	SELECT
		p.payslip_id,
		p.employee_id,
		CONCAT(e.first_name, ' ', e.last_name) AS employee_name,
		p.position,
		p.department,
		p.monthly_rate,
		p.hourly_rate,
		p.payable_hours,
		p.overtime,
        ROUND((p.hourly_rate*p.payable_hours) + p.overtime,2) AS total,
		rs.amount AS rice_subsidy,
		pho.amount AS phone_allowance,
		ca.amount AS clothing_allowance,
		p.total_allowance,
		p.gross_salary,
		sss.amount AS sss,
		phi.amount AS philhealth,
		pg.amount AS pag_ibig,
		wt.amount AS withholding_tax,
		p.total_deductions,
		p.net_salary,
		p.generated_date,
		pp.start_date AS pay_period_start,
		pp.end_date AS pay_period_end,
		pp.pay_day
	FROM payslip p
	JOIN employee_personal_information e ON p.employee_id = e.employee_id
	JOIN payroll_record pr ON p.payroll_id = pr.payroll_id
	JOIN (
		SELECT
			pa.payroll_id AS payroll_id,
			pa.amount AS amount
		FROM payroll_allowance pa
		JOIN employee_default_allowance eda
			ON pa.source_allowance_id = eda.employee_allowance_id
		WHERE eda.allowance_id IN (1)
	) rs
		ON p.payroll_id = rs.payroll_id
	JOIN (
		SELECT
			pa.payroll_id AS payroll_id,
			pa.amount AS amount
		FROM payroll_allowance pa
		JOIN employee_default_allowance eda
			ON pa.source_allowance_id = eda.employee_allowance_id
		WHERE eda.allowance_id IN (2)
	) pho
		ON p.payroll_id = pho.payroll_id
	JOIN (
		SELECT
			pa.payroll_id AS payroll_id,
			pa.amount AS amount
		FROM payroll_allowance pa
		JOIN employee_default_allowance eda
			ON pa.source_allowance_id = eda.employee_allowance_id
		WHERE eda.allowance_id IN (3)
	) ca
		ON p.payroll_id = ca.payroll_id
	JOIN (
		SELECT
			ed.payroll_id AS payroll_id,
			ed.amount AS amount
		FROM employee_government_deduction ed
		JOIN government_deduction_chart gc
			ON ed.chart_id = gc.gov_deduction_chart_id
		WHERE gc.gov_deduction_type_id IN (1)
	) sss
		ON pr.payroll_id = sss.payroll_id
	LEFT JOIN (
		SELECT
			ed.payroll_id AS payroll_id,
			ed.amount AS amount
		FROM employee_government_deduction ed
		JOIN government_deduction_chart gc
			ON ed.chart_id = gc.gov_deduction_chart_id
		WHERE gc.gov_deduction_type_id IN (3)
	) phi
		ON pr.payroll_id = phi.payroll_id
	LEFT JOIN (
		SELECT
			ed.payroll_id AS payroll_id,
			ed.amount AS amount
		FROM employee_government_deduction ed
		JOIN government_deduction_chart gc
			ON ed.chart_id = gc.gov_deduction_chart_id
		WHERE gc.gov_deduction_type_id IN (2)
	) pg
		ON pr.payroll_id = pg.payroll_id
	JOIN (
		SELECT
			ed.payroll_id AS payroll_id,
			ed.amount AS amount
		FROM employee_government_deduction ed
		JOIN government_deduction_chart gc
			ON ed.chart_id = gc.gov_deduction_chart_id
		WHERE gc.gov_deduction_type_id IN (4)
	) wt
		ON pr.payroll_id = wt.payroll_id
	JOIN pay_period pp ON pr.pay_period_id = pp.pay_period_id
    WHERE p.employee_id = input_employee_id
      AND pr.payroll_id IN (
          SELECT payroll_id FROM payroll_record WHERE pay_period_id = input_pay_period_id
      );
END ;;
DELIMITER ;
